('22',NULL,'53','1038','1501038','Papaya- Paka Pepe  50 gm','-     ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1009','EB1009','139','139',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-20 19:13:51',NULL,'2022-03-20 19:13:51',NULL,'papaya-paka-pepe-50-gm','0',NULL,NULL,'Fruits -  | Papaya- Paka Pepe  50 gm | -     ','Fruits ,  , Papaya,Paka Pepe , 50 gm , ,  ,  ',NULL,NULL,NULL,'<p><span style=\"color: rgb(10, 10, 10); font-family: Montserrat, sans-serif; font-size: 16px; letter-spacing: normal; background-color: rgb(254, 254, 254);\">Papaya, also known as pawpaw</span><span style=\"color: rgb(10, 10, 10); font-family: Montserrat, sans-serif; font-size: 16px; letter-spacing: normal; background-color: rgb(254, 254, 254);\">&nbsp;or papaw, is a tropical fruit.</span><br></p>',NULL,'<p><span style=\"font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">Deliciously sweet, papaya fruit is another gift of Mexicans to this world. This exotic fruit is packed with numerous health-benefiting nutrients. It is one of the favorites of fruit lovers for its nutritional, digestive, and medicinal properties.</span></p><p style=\"box-sizing: inherit; font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">The papaya tree bears many spherical or pear-shaped fruits clumped together near its top end of the trunk. They come in a variety of sizes ranging from 6-20 inches in length and 4-12 inches in diameter. The average-sized papaya weighs about a pound. The fruit is said to ripen when it yields to gentle thumb pressure, and its skin turned amber to an orange tint.</p><p style=\"box-sizing: inherit; font-family: &quot;Helvetica Neue&quot;, sans-serif; font-size: 16px; letter-spacing: normal;\">Inside, the fruit features numerous black peppercorn-like seeds, encased in a mucin coat concentrated at its hollow, central cavity as in melons. The flesh is orange in color with either yellow or pink hues, soft, and has a deliciously sweet taste with a rich, musky flavor.</p><p><br></p>','<p> ,             -     ,         </p><div>     -              6-20   4-12                            ,         </div><div>,       ,     ,                , ,   ,        <br></div>'),
