('24',NULL,'53','1077','1501077','Pomegranate (Dalim)','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1011','EB1011','190','190',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','2','1',NULL,NULL,'2','2022-03-20 20:47:50','2','2022-06-16 17:31:34',NULL,'pomegranate-dalim','0',NULL,NULL,'Fruits -  | Pomegranate (Dalim) |  - 2 Pcs','Fruits ,  |, Pomegranate , Dalim , ,  2 Pcs',NULL,NULL,NULL,'<p>Pomegranate (Dalim)-<br></p>',NULL,'<p><span style=\"color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">Pomegranate</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; letter-spacing: normal;\">fruit is one of the most popular, nutritionally rich fruit with unique flavor, taste, and health promoting characteristics.</span></p><p><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Red-purple in color, the pomegranate fruit husk</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">has two parts: an outer, hard</span> pericarp<span style=\"box-sizing: border-box; font-size: 1rem; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; color: rgb(32, 33, 34); font-family: sans-serif;\"></span>pericarp<span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">, and an inner, spongy</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">mesocarp (white \"albedo\"), which comprises the fruit inner wall where seeds attach.</span><span style=\"font-size: 1rem; color: rgb(32, 33, 34); font-family: sans-serif;\">Membrane</span>s of the mesocarp are organized as nonsymmetric chambers that contain seeds inside sarcotestas, which are embedded without attachment to the mesocarp. Containing juice, the sarcotestas is formed as a thin membrane derived from the epidermal cells of the seeds. The number of seeds in a pomegranate can vary from 200 to about 1,400.</p>','<p>   , ,       ,     </p><p>- ,      :  ,   ,   ,   ( \"\"),                      ,          ,                   ,   <br></p>'),
