('45',NULL,'53','1054','1501054','Elephant Apple (Chalta)','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','WEIGHT','1025','EB1025','35','35',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-03-21 17:51:48',NULL,'2022-03-21 17:51:48',NULL,'elephant-apple-chalta','0',NULL,NULL,'Fruits |Elephant Apple (Chalta) |   | Each','Fruits,Elephant Apple, Chalta ,   , Each , apple , chalta',NULL,NULL,NULL,'<p>Elephant Apple (Chalta)<br></p>',NULL,'<p>Chalta is an eternally green shrub, with the trees often grow up to a height of 15 m. The reddish-brown barks hold strong branches with broad serrated leaves. The flowers bloom in summer, being bright white with many petals and sprout into the tangy chalta fruit in colder climates.</p><p><br></p><p>An expansive array of useful plant constituents are present in chalta fruits, making them a prominent source of vital nutrients. They are inherently rich in vitamin C, vitamin B complex, vitamin E, potassium, healthy fats, amino acids and proteins, besides being low in cholesterol. Moreover, chalta abounds in beneficial phytochemicals namely tannins, saponins, flavonoids, triterpenoids and phenolics, which supply powerful anticancer, antibacterial and antioxidant characteristics.</p>',NULL),
