('366',NULL,'53','1070','1501070','Malta (Special Offer)  50 gm',' ( )  50 ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1308','EB1308','359','329',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,'2','2022-05-26 13:47:20',NULL,'2022-05-26 13:47:20',NULL,'malta-special-offer-50-gm','0','Malta',NULL,'Malta (Special Offer)  50 gm','Malta (Special Offer','Malta (Special Offer)  50 gm',NULL,NULL,'<p> ( )<br></p>',NULL,'<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;segoe ui&quot;, Helvetica, &quot;droid sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; letter-spacing: normal;\">Malta, a variety of orange, is a popular citrus fruit cultivated in hot climate. The fruit is rich in mineral salts and other ingredients of nutritive value such as iron, lime, phosphorus, and vital minerals. Malta is loaded with vitamin C and vitamin B complex. It is a round-shaped, medium-sized fruit, weighting an average of 145.8 gm. It has a rough-surfaced orange ringed with a segment of around 9.67 centimetres and a sweet-tasting juice content of around 33.7 per cent. The fruit is often used to make processed juice, jam, jelly and marmalade.</span><br></p>',NULL),
('367',NULL,'53','1071','1501071','China Fuji Apple  50 gm','    50 ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'29','Weight','1309','EB1309','235','229',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1','2','1',NULL,NULL,'2','2022-05-26 13:53:20',NULL,'2022-05-26 13:53:20',NULL,'china-fuji-apple-50-gm','0','China Fuji Apple',NULL,'China Fuji Apple  50 gm','China Fuji Apple  50 gm','China Fuji Apple  50 gm',NULL,NULL,'<p>  &nbsp;<br></p>',NULL,'<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;segoe ui&quot;, Helvetica, &quot;droid sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; letter-spacing: normal;\">Apples are some of the most popular and delicious fruits on the planet. There are more than 7,500 varieties of this delicious fruit. China Fuji Apple is one of them. Fuji apples are typically round and range from large to very large, averaging 75 mm in diameter. They contain between 911% sugars by weight and have a dense flesh that is sweeter and crisper than many other apple cultivars, making them popular with consumers around the world. Fuji apples also have a very long shelf life compared to other apples, even without refrigeration. With refrigeration, Fuji apples can remain fresh for up to a year. Fuji apples are a variety of apple that originates in Japan. They are yellowish-green in color with red highlights. Harvested in September and October. Fuji apples are a healthy addition to most diets. They have no fat, sodium or cholesterol. A medium-sized apple weights about 154 grams and provides 80 calories. The FDA categorizes Fuji apples as a low-calorie food. Calories come from carbohydrates, proteins, fats and sugar. Any calories that your body does not use is stored as fat. A medium-sized Fuji apple also provides 170 milligrams of potassium. It offers 20 percent of the recommended daily value for vitamin C and 2 percent of the DV for vitamin A, calcium and iron, based on a 2,000-calorie diet.</span><br></p>',NULL),
