insert  into `WEB_PAGES`(`PK_NO`,`TITLE`,`SUB_TITLE`,`URL_SLUG`,`POSITION`,`BODY`,`FEATURE_IMAGE`,`BANNER`,`ORDER_ID`,`IS_ACTIVE`,`SS_MODIFIED_ON`,`SS_CREATED_ON`,`F_SS_CREATED_BY`,`F_SS_MODIFIED_BY`,`META_KEYWARDS`,`META_DESCRIPTION`,`FOR_APP`,`SECTION`,`ICON`) values 
('37','about us',NULL,'about-us',NULL,'<p>Did you ever imagine that the freshest fruits and vegetables, top quality pulses and food grains, dairy products and hundreds of branded items could be handpicked and delivered to your home, all at the click of a button? Bangladeshs first comprehensive online megastore, easybazar.com, brings a whopping 20000+ products with more than 1000 brands, to over 4 million happy customers. From household cleaning products to beauty and makeup, BigBasket has everything you need for your daily needs. easybazar.com is convenience personified Weve taken away all the stress associated with shopping for daily essentials, and you can now order all your household products and even buy groceries online without traveling long distances or standing in serpentine queues. Add to this the convenience of finding all your requirements at one single source, along with great savings, and you will realize that BigBasket- Bangladeshs largest online supermarket, has revolutionized the way Bangladesh shops for groceries. Online grocery shopping has never been easier. Need things fresh? Whether its fruits and vegetables or dairy and meat, we have this covered as well! Get fresh eggs, meat, fish, and more online at your convenience. Hassle-free Home Delivery options</p><p><br></p><p>We deliver to 25 cities across Bangladesh and maintain excellent delivery times, ensuring that all your products from groceries to snacks branded foods reach you in time.</p><p><br></p><p>Slotted Delivery: Pick the most convenient delivery slot to have your grocery delivered. From early morning delivery for early birds to late-night delivery for people who work the late shift, bigbasket caters to every schedule.</p><p>Express Delivery: This super useful service can be availed by customers in cities like Bangalore, Mumbai, Pune, Chennai, Kolkata, Hyderabad, and Delhi-NCR in which we deliver your orders to your doorstep in 90 Minutes.</p><p>BB Specialty stores: Missed out on buying that essential item from your favorite neighborhood store for tonights party? Well deliver it for you! From bakery, sweets, and meat to flowers and chocolates, we deliver your order in 90 minutes, through a special arrangement with a nearby specialty store, verified by us.</p><div><div>easybazar.com believes in providing the highest level of customer service and is continuously innovating to meet customer expectations. Our On-time Guarantee is one such assurance where we refund 10% of the bill value if the delivery is delayed. For all your order values above Rs. 1000, we provide free delivery. A wide range of imported and gourmet products are available through our express delivery and slotted delivery service. If you ever find an item missing on delivery or want to return a product, you can report it to us within 48 hours for a no-questions-asked refund.</div><div><br></div><div>Best quality products for our quality-conscious customers.</div><div><br></div><div>easybazar.com is synonymous with superior quality and continues to strive for higher levels of customer trust and confidence, by taking feedback and giving our customers what they want. We have added the convenience of pre-cut fruits in our Fresho range. If its a product category youre looking to shop from, weve made it convenient for you to access all products in a section easily. For instance, if youre looking for beverages, you can order from a long list of beverages that include cool drinks, hot teas, fruit juices, and more.</div><div><br></div><div>We are proud to be associated closely with the farmers from whom we source our fresh products. Most of our farm-fresh products are sourced directly from farmers, which not only ensures the best prices and freshest products for our customers but also helps the farmers get better prices. With more than 80 Organic Fruits and Vegetables and a wide range of organic staples, BigBasket has the largest range in the organic products category.</div><div><br></div><div>When it comes to payment, we have made it easy for our customers can pay through multiple payment channels like Credit and Debit cards, Internet Banking, e-wallets, and Sodexo passes or simply pay Cash on Delivery (COD). The convenience of shopping for a home and daily needs, while not compromising on quality, has made easybazar.com the online supermarket of choice for thousands of happy customers across Bangladesh.</div></div>',NULL,NULL,'1','1',NULL,NULL,'2','2',NULL,NULL,'0','1',NULL);
